import productimg1 from './productsimages/Rectangle 3.png';
import productimg2 from './productsimages/Rectangle 4.png';
import productimg3 from './productsimages/Rectangle 5.png';
import productimg4 from './productsimages/Rectangle 6.png';

const ProductsData = [
    {
        productimg : productimg1
    },
    {
        productimg : productimg2
    },
    {
        productimg : productimg3
    },
    {
        productimg : productimg4
    }
]

export default ProductsData;
